import React from 'react'

function TextBox(props){
    
        return(
            <div className="col-3 offset-1">
                <div>
                    {props.text}
                </div>
                <div>
                    <button onClick={props.onClick}>Vaihda Teksti</button>
                </div>
            </div>
        )
}

export default TextBox
